	/**
	 * 获取页面里面的
	 *
	 * $res[] = array($title[1] , $size[1] , $time[1] , strtotime($time[1]),$baseUrl . $download[1] , $q_num);
	 * @param	string	$page	页面的内容构成的str
	 * @return	array(title , size ,time ,timestamp , url,q_num);
	 */	
	function getPageRows($page){
		$this->HtmlParserModel->parseStr($page, array(), "BIG5");
		$lines = $this->HtmlParserModel->find('#ctl00_gvMain');
		if(empty($lines) || !trim($lines[0]->value)){
			echo "no data\n";
			return false;
		}
		$this->HtmlParserModel->parseStr($lines[0]->value , array() , 'BIG5');
		$lines = $this->HtmlParserModel->find('tr');
		$res = array();
		$baseUrl = "http://www.hkexnews.hk/";
		foreach($lines as $line){
			$tmpStr = $line->value;
			
			//$tmpStr = "sdfa 12/02/3221 sdf";
			preg_match('/\>\s*(\d{2}\s*\/\s*\d{2}\s*\/\s*\d{4}\s*)\s*\</' , $tmpStr , $time);
			if(count($time) != 2){
				Debug::output('time is wrong' , E_NOTICE);
				continue;
			} else {
				$tmp = explode('/' , $time[1]);
				$tmp2[0] = $tmp[2];
				$tmp2[1] = $tmp[1];
				$tmp2[2] = $tmp[0];
				$time[1] = implode('-' , $tmp2);
			}
			//$tmpStr = "<a href=\"finalpage/2014-03-07/63646348.PDF\" target=\"new\">平安银行：2013年年度报告摘要</a>";
			preg_match('/href\=\s*[\'\"]?\s*([^"\']+)/' , $tmpStr , $download);
			if(count($download) != 2){
				var_dump($tmpStr);
				Debug::output('download link' , E_NOTICE);
				continue;
			}
			//preg_match('/href\=\"([^\s]*)\"\s+/' , $tmpStr , $download);
			preg_match('/\>\s*\(\s*(\d*)\s*KB,\s*\s*/' , $tmpStr , $size);
			if(count($size) != 2){
				var_dump($tmpStr);
				Debug::output('size is wrong' , E_NOTICE);
				continue;
			}

			preg_match('/StockName\s*\"\s*\>\s*([^\>]*)\s*\<\s*\\/span\s*\>/' , $tmpStr , $stockName);
			if(count($stockName) != 2){
				var_dump($stockName);
				var_dump($tmpStr);
				Debug::output('title is wrong' , E_NOTICE);
				continue;	
			}
			//$tmpStr = "<a href='finalpage/2008-04-22/38959757.PDF' target='new'>*ST宜地：2007年年度报告（补充后）</a>";
			preg_match('/\>\s*([^\>]*)\s*\<\s*\\/a\s*\>/' , $tmpStr , $title);
			if(count($title) != 2){
				var_dump($tmpStr);
				Debug::output('title is wrong' , E_NOTICE);
				continue;
			}
			/*
			var_dump($title[1]);
			var_dump($stockName[1]);
			 */
			$title[1] = mb_convert_encoding($stockName[1] . $title[1] ,'UTF-8' , $this->encoding);
			$q_num = $this->checkSeason($title[1]);
			if(!$q_num){
				echo ('qNum is false : ' . $title[1] . "\n");
				sleep(2);
			}
			$res[] = array($title[1] , $size[1] , $time[1] , strtotime($time[1]),$baseUrl . $download[1] , $q_num);
		}
		return $res;
	}

	/**
	 * 根据title 检测对应的季节
	 *
	 * @param	string	$title	标题，标题里面有关键字
	 * @return q(1/2/3/4)
	 **/
	public function checkSeason($title )
	{
		//去除空格以免 年  报这种情景
		$arr = explode(' ' , $title);
		$title = implode('' , $arr);
		/*
		$title = "長江實業二零一三年度中期報告";
		var_dump(strpos($title , '年报'));
		var_dump(strpos($title , '年度'));
		var_dump(strpos($title , '年報'));
		die;
		 */
		if(strpos($title , '第2') || strpos($title , '第二') || strpos($title , '中期') || strpos($title , '半年') || strpos($title , '中報')){
			return 'q2';
		}
		if(strpos($title , '第三') || strpos($title , '第3')){
			return 'q3';
		}
		if(strpos($title , '第一') || strpos($title , '第1')){
			return 'q1';
		}
		if(strpos($title , '年报') || strpos($title  , '年報') || strpos($title , '年度')){
			return 'q4';
		}
		return false;

	}
