	//下一页，是从上一页的hidden value中提取的
	public function secPage($code = '00001' , $notice = '1')
	{
		$this->DataBaseModel->setTables($this->config['shenpage']);
		$data = $this->DataBaseModel->select('pid, notice , code ,content' , array('notice' => '-2' , 'pageId' => '1'));
		//获取第二页`
		$overflow = array();
		foreach ($data  as $page ) {
			if(strlen($page['code']) !== 5){
				echo "continuing\n";
				continue;	
			}
			$page['content'] = trim(base64_decode($page['content']));
			echo strlen($page['content']) . "\n";
			$res = $this->parsePage($page['content']);
			if(empty($res) || $res['total'] <= 20 ){
				continue;
			}
			$state = $this->getViewState($page['content']);
			if(!$state){
				//没有输入的hidden input情况
				echo "no state   "  . $page['code']. "\n\n";
				die("sdf");
			}
			$secPage = $this->httpGetSecPage($state);
			$res = $this->parsePage($secPage);
			if($res['now'] > 19){
				$this->DataBaseModel->insert(
					array('code' , 'pageId' , 'content' , 'notice' , 'q_num'),
					array(array( $page['code'],'2' ,base64_encode($secPage) , '-2' , '-1'))
				) && printf( "{$page['code']} insert success<br/>\n\n");	
			}
			if($res['total'] > 40){
				echo "有的数据大于40\n\n";
				$overflow[] = $page['code'];
				sleep(3);
			}
		}
		var_dump($overflow);
	}

